        <Icon src="/social/medium.svg" alt="Vilva's Medium Account" />
        <Icon src="/social/github.svg" alt="Vilva's Github Account" />
        <Icon src="/social/instagram.svg" alt="Vilva's Instagram Account" />
        <Icon src="/social/discord.svg" alt="Vilva's Discord Account" />
        <Icon src="/social/gmail.svg" alt="Vilva's Gmail Account" />
      </IconContainer>
    </>
  );
}
